import axios from 'axios';
import React, { useEffect, useState } from 'react'
import { useParams } from 'react-router-dom'

function Read() {
    const {id} = useParams();
    const [user, setUser] = useState([])
    useEffect(()=> {
        axios.get('http://localhost:8081/read/'+id)
        .then(res =>{
            console.log(res);
            setUser(res.data);
        })
        .catch(err => console.log(err))
    }, [])
  return (
    <div>Read</div>
  )
}

export default Read
